p=int(input("Enter Your Percentage:"))
if(p>=90):
    print("You Have Gotten A")
elif(p>=80 and p<=89):
    print("You Have Gotten B")
elif(p>=70 and p<=79):
    print("You Have Gotten C")
elif(p>=60 and p<=69):
    print("You Have Gotten D")
elif(p>=50 and p<=59):
    print("You Have Gotten E")
else:
    print("You Have Failed")